import React from 'react'


const Box = (props) => {

  let result;
  if(props.title==="컴퓨터" &&
    props.result !== "tie" && 
    props.result !== "" ){
    result = props.result=== "WIN" ? "lose" :"WIN";
  }else{
    result = props.result;
  }

  return (
    <div className='main'>
      <h3>{props.title}</h3>
      <img className='img-size' src={props.item&&props.item.img}/>
      <h2>{result}</h2>
    </div>
  )
}

export default Box
